import React, { useEffect, useState } from 'react'
import { useAuth } from './context/AuthContext'
import { useNavigate } from 'react-router-dom';
function Home() {
  const [data, setData] = useState();
  const fetchData = () =>{
    fetch(`https://api.themoviedb.org/3/movie/popular?api_key=6e881770f21e62c1d208087353523087&language=es-ES&page=1
`)
        .then((promise) => promise.json())
        .then((data) => setData(data))
        .catch((err)=>console.log(err))
  }
  useEffect(()=>{
    fetchData();
  }, [])


    const navigate = useNavigate();;
    const { user, logout } = useAuth();
    const handleLogOut = () =>{
        logout();
        navigate("/")
    }
  return (
    <div className='relative'>Welcome

        <h1>{user?.name}</h1>
        <p>{user?.role}</p>
        {user?.role ==="administrador" && <button className='absolute top-0 right-0 px-4 py-2 rounded bg-blue-500'>Añadir película</button>}
        <button className='bg-black text-white px-4 py-2 rounded' onClick={handleLogOut}>SALIR</button>

        <div>{data.id}ass</div>
    </div>
  )
}

export default Home
